# {"question_id":"197","subject_id":"1","subject_parent_id":"0","subject_child_id":"0","question_text":"<p>Два автомобиля движутся по прямому шоссе: первый&nbsp; со скоростью <img src=\"http:\/\/reshuege.ru\/formula\/a0\/a068e9d5cfdca492a9bbbcc8d296989f.png\" class=\"tex\" style=\"vertical-align:-4px\" width=\"8, второй&nbsp; со скоростью <img src=\"http:\/\/reshuege.ru\/formula\/6a\/6aecfefc2f4fd0c9ffff8cb326528ae5.png\" class=\"tex\" style=\"vertical-align:-5px\" width=\"37. Какова скорость второго автомобиля относительно первого?<\/p>","question_group":"0","question_attached":"","question_points":"1","question_type":"0"},
