# {"question_id":"314","subject_id":"3","subject_parent_id":"0","subject_child_id":"0","question_text":"<p>03_0002.gif<span style=\"font-size: 14pt; line-height: 115%; font-family: 'Times New Roman', serif;На рисунке схематически изображена лестница АС, прислоненная к стене. Каков момент силы реакции опоры<\/span><span style=\"font-size: 14pt; line-height: 115%; font-family: 'Times New Roman', serif;\" lang=\"EN-US N<\/span><span style=\"font-size: 14pt; line-height: 115%; font-family: 'Times New Roman', serif;, <\/span><span style=\"line-height: 115%;<span style=\"font-size: 14pt;действующей на лестницу относительно точки В?<\/span><p><span style=\"font-size: 14pt; line-height: 115%; font-family: 'Times New Roman', serif;<p><span style=\"font-size: 14pt; line-height: 115%; font-family: 'Times New Roman', serif;","question_group":"0","question_attached":"","question_points":"1","question_type":"0"},
# {"question_id":"315","subject_id":"3","subject_parent_id":"0","subject_child_id":"0","question_text":"<p><span style=\"font-size:14.0pt;line-height:115%;\r\nfont-family:&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:Calibri;\r\nmso-ansi-language:RU;mso-fareast-language:EN-US;mso-bidi-language:AR-SAВ\r\nсообщающийся сосуд (см. рис) налили три жидкости одинакового объема: ртуть - в\r\nправое колено, бензин - в левое колено, воду - в среднее. Какой рисунок\r\nправильно показывает расположение жидкостей в сосуде.<p>03_0003.gif<span style=\"font-size:14.0pt;line-height:115%;\r\nfont-family:&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:Calibri;\r\nmso-ansi-language:RU;mso-fareast-language:EN-US;mso-bidi-language:AR-SA&nbsp;","question_group":"0","question_attached":"","question_points":"1","question_type":"0"},
# {"question_id":"316","subject_id":"3","subject_parent_id":"0","subject_child_id":"0","question_text":"<p><span style=\"font-size:14.0pt;line-height:115%;\r\nfont-family:&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:Calibri;\r\nmso-ansi-language:RU;mso-fareast-language:EN-US;mso-bidi-language:AR-SAНа\r\nрычаг действуют две силы, плечи которых равны <st1:metricconverter productid=\"0,1 м\" w:st=\"on0,1 м<\/st1:metricconverter> и <st1:metricconverter productid=\"0,3 м\" w:st=\"on0,3 м<\/st1:metricconverter>. Сила, действующая на\r\nкороткое плечо, равна 3 Н. Чему должна быть равна сила, действующая на длинное\r\nплечо, чтобы рычаг был в равновесии?","question_group":"0","question_attached":"","question_points":"1","question_type":"0"},
