# {"question_id":"2560","subject_id":"54","subject_parent_id":"0","subject_child_id":"0","question_text":"Их гумусовый горизонт, как правило, не бывает толще 1 см. Редкие мхи и лишайники практически не дают \"материала\" для образования гумуса<br>","question_group":"0","question_attached":"","question_points":"1","question_type":"0"},
# {"question_id":"2561","subject_id":"54","subject_parent_id":"0","subject_child_id":"0","question_text":"<p>При избытке влаги и недостатке кислорода в почве происходит восстановление главным образом соединений железа, которые и придают почве зеленоватую и голубовато-серую окраску.<br>Другая особенность этих почв - малое содержание гумуса. Мощность окрашенного гумусом горизонта не превышает 5 - 8 см.<br><\/p>","question_group":"0","question_attached":"","question_points":"1","question_type":"0"},
# {"question_id":"2562","subject_id":"54","subject_parent_id":"0","subject_child_id":"0","question_text":"<p>Они формируются преимущественно под хвойными лесами в условиях избыточного увлажнения. Главная отличительная черта этих почв - наличие хорошо выраженного горизонта вымывания и кислая реакция. <br><\/p>","question_group":"0","question_attached":"","question_points":"1","question_type":"0"},
# {"question_id":"2563","subject_id":"54","subject_parent_id":"0","subject_child_id":"0","question_text":"<p>Эти почвы формируются под смешанными широколиственно-хвойными лесами. В них достаточно хорошо развит гумусовый горизонт (10-20 см). <br><\/p>","question_group":"0","question_attached":"","question_points":"1","question_type":"0"},
# {"question_id":"2564","subject_id":"54","subject_parent_id":"0","subject_child_id":"0","question_text":"<p>Под смешанными и широколиственными лесами в условиях относительно теплого и влажного муссонного климата образуются эти почвы. <br>Они довольно плодородны и издавна используются в земледелии<br><\/p>","question_group":"0","question_attached":"","question_points":"1","question_type":"0"},
# {"question_id":"2565","subject_id":"54","subject_parent_id":"0","subject_child_id":"0","question_text":"Ежегодно отмиравший густой травяной покров давал ежегодно большое количество опада. Теплое длительное лето способствовало разложению растительных остатков и образованию перегноя.<br>В этих почвах из-за отсутствия промывного режима постепенно накапливалось большие количество гумуса.<br>","question_group":"0","question_attached":"","question_points":"1","question_type":"0"},
# {"question_id":"2566","subject_id":"54","subject_parent_id":"0","subject_child_id":"0","question_text":"В южных степях климат сухой , а растительный покров разрешенный. Гумуса при этом накапливается меньше и почва приобретает коричневый цвет.<br>","question_group":"0","question_attached":"","question_points":"1","question_type":"0"},
# {"question_id":"2567","subject_id":"54","subject_parent_id":"0","subject_child_id":"0","question_text":"Почвы пустынь<br>","question_group":"0","question_attached":"","question_points":"1","question_type":"0"},
