# {"question_id":"11759","subject_id":"2","subject_parent_id":"49","subject_child_id":"72","question_text":"У исполнителя Бета две команды, которым присвоены номера:<br\/>1. прибавь b<br\/>2. умножь на 3(b&nbsp; &ndash; неизвестное натуральное число) <br\/>Выполняя первую из них, Бета увеличивает число на экране на b, а выполняя вторую, умножает это число на 3. Программа для исполнителя Бета&nbsp; &ndash; это последовательность номеров команд. Известно, что программа 21212 переводит число 8 в число 360. Определите значение b.","question_group":"11759","question_attached":"0","question_points":"1","question_type":"2"},
